// client/src/components/FlightLandingForm.jsx

import React, { useState } from 'react';
import axios from 'axios';
import './Form.css';

export default function FlightLandingForm() {
  const [flightID, setFlightID] = useState('');
  const [msg, setMsg]       = useState('');
  const [error, setError]   = useState('');

  const handleSubmit = async e => {
    e.preventDefault();
    try {
      await axios.post('/api/flight_landing', { flightID });
    } catch (err) {
      setError(err.response?.data?.error || 'Error processing landing');
      setMsg('');
    }
  };

  return (
    <form className="form-container" onSubmit={handleSubmit}>
      <h2>flight_landing()</h2>
      <div className="form-grid">
        <div className="form-group">
          <label>Flight ID</label>
          <input
            name="flightID"
            value={flightID}
            onChange={e => setFlightID(e.target.value)}
            required
          />
        </div>
      </div>
      <div className="form-actions">
        <button type="submit">Process Landing</button>
      </div>
      {msg   && <p className="message">{msg}</p>}
      {error && <p className="error-text">{error}</p>}
    </form>
);
}
